import { HashRouter, Routes, Route } from "react-router-dom";
import Viewfeedback from "./view_feedback";
import Addfeedback from "./add_feedback";

const Fbportal = () => {
  return (
    <HashRouter>
      <Viewfeedback />
      <Routes>
        <Route exact path="/Addfeedbac" element={<Addfeedback />} />
      </Routes>
    </HashRouter>
  );
};

export default Fbportal;
